import './App.css';
import { Routes, Route } from 'react-router-dom';
import Home from './components/home';
import Assessment from './components/assessment';
import Exercise from './components/exercise';
import Resouce from './components/resource';
import PrivateRoutes from './utils/PrivateRoutes';
import AdminPrivateRoutes from './utils/PrivateRoutes';
import PublicRoutes from './utils/PublicRoutes';
import AdminPublicRoutes from './utils/PublicRoutes';
import { AuthProvider } from './context/AuthContext';
import { AdminAuthProvider } from './context/AdminAuthContext';

import AdminLogin from './context/admin_login'



function App() {
  return (

    <div className='App'>
      <AuthProvider>
        <Routes>
            <Route element={<PublicRoutes />}>
              <Route path='/login' element={<Home />} />
            </Route>
            <Route element={<PrivateRoutes />}>

                <Route path='/' element={<Assessment />} />
                <Route path='/exercise' element={<Exercise />} />
                <Route path='/resource' element={<Resouce />} />


            </Route>

        </Routes>
      </AuthProvider>
      <AdminAuthProvider>
        <Routes>

            <Route element={<AdminPublicRoutes />}>
                <Route path='/login' element={<Adminlogin />} />
            </Route>

            <Route element={<AdminPrivateRoutes />}>
                <Route path='/' element={<Assessment />} />
                <Route path='/exercise' element={<Exercise />} />
                <Route path='/resource' element={<Resouce />} />
            </Route>

        </Routes>
      </AdminAuthProvider>
    </div>

  );

}

export default App;
